import React from "react";
import { Link } from "react-router-dom";
import "bootstrap/dist/css/bootstrap.min.css";
import "bootstrap/dist/js/bootstrap.bundle.min.js";

const Navbar = () => {
  return (
    <nav
      className="navbar navbar-expand-md fixed-top"
      style={{
        backgroundColor: "#4CAF50", // Change to any color you like
        padding: "15px 0",
        width: "100%",
      }}
    >
      <div
        className="container-fluid" // Full width, no left/right padding
        style={{
          margin: "0",
          padding: "0 30px", // Optional: adjust this for inner spacing
        }}
      >
        {/* Logo */}
        <Link
          className="navbar-brand"
          to="/"
          style={{
            fontSize: "28px",
            fontWeight: "bold",
            color: "#fff",
            textDecoration: "none",
          }}
        >
          Nutri<span style={{ color: "#fff" }}>Fit</span>-Hub üçè
        </Link>

        {/* Toggle Button */}
        <button
          className="navbar-toggler"
          type="button"
          data-bs-toggle="collapse"
          data-bs-target="#navbarNav"
          aria-controls="navbarNav"
          aria-expanded="false"
          aria-label="Toggle navigation"
        >
          <span className="navbar-toggler-icon"></span>
        </button>

        {/* Navigation Links */}
        <div className="collapse navbar-collapse justify-content-end" id="navbarNav">
          <ul className="navbar-nav">
            <li className="nav-item">
              <Link className="nav-link text-white" style={{ fontSize: "18px" }} to="/">Home</Link>
            </li>
            <li className="nav-item">
              <Link className="nav-link text-white" style={{ fontSize: "18px" }} to="/about">About</Link>
            </li>
            <li className="nav-item">
              <Link className="nav-link text-white" style={{ fontSize: "18px" }} to="/dashboard">Dashboard</Link>
            </li>
            <li className="nav-item">
              <Link className="nav-link text-white" style={{ fontSize: "18px" }} to="/services">Services</Link>
            </li>
            <li className="nav-item">
              <Link className="nav-link text-white" style={{ fontSize: "18px" }} to="/contact">Contact</Link>
            </li>
          </ul>
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
